import React, { useState, useEffect } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { Elements } from '@stripe/react-stripe-js';
import { loadStripe } from '@stripe/stripe-js';

// Components
import HomePage from './components/HomePage';
import Login from './components/Auth/Login';
import CreateAccount from './components/Auth/CreateAccount';
import MembershipSelection from './components/Auth/MembershipSelection';
import PaymentPage from './components/Payment/PaymentPage';
import SmartEventEntry from './components/Features/SmartEventEntry';
import AutoTaskScheduler from './components/Features/AutoTaskScheduler';
import GroupAvailability from './components/Features/GroupAvailability';
import HabitRecommendations from './components/Features/HabitRecommendations';
import ProtectedRoute from './components/Common/ProtectedRoute';
import Navbar from './components/Common/Navbar';

// Load Stripe
const stripePromise = loadStripe(process.env.REACT_APP_STRIPE_PUBLIC_KEY);

function App() {
  const [user, setUser] = useState(null);
  const [membership, setMembership] = useState(null);

  // Check for any saved user and membership data on app load
  useEffect(() => {
    const savedUser = localStorage.getItem('user');
    const savedMembership = localStorage.getItem('membership');

    if (savedUser) {
      setUser(JSON.parse(savedUser));
    }

    if (savedMembership) {
      setMembership(savedMembership);
    }
  }, []);

  // Handle user login
  const loginUser = (userData) => {
    setUser(userData);
    localStorage.setItem('user', JSON.stringify(userData));
  };

  // Handle user logout
  const logoutUser = () => {
    setUser(null);
    setMembership(null);
    localStorage.removeItem('user');
    localStorage.removeItem('membership');
  };

  // Handle membership update
  const updateMembership = (membershipType) => {
    setMembership(membershipType);
    localStorage.setItem('membership', membershipType);
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {user && <Navbar user={user} logoutUser={logoutUser} />}

      <Elements stripe={stripePromise}>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<Login loginUser={loginUser} />} />
          <Route path="/create-account" element={<CreateAccount loginUser={loginUser} />} />

          {/* Protected routes that require authentication */}
          <Route 
            path="/membership" 
            element={
              <ProtectedRoute user={user}>
                <MembershipSelection updateMembership={updateMembership} />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/payment" 
            element={
              <ProtectedRoute user={user}>
                <PaymentPage 
                  membership={membership} 
                  updateMembership={updateMembership} 
                />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/smart-event-entry" 
            element={
              <ProtectedRoute user={user}>
                <SmartEventEntry />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/auto-task-scheduler" 
            element={
              <ProtectedRoute user={user} membership={membership} requiredMembership="premium">
                <AutoTaskScheduler />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/group-availability" 
            element={
              <ProtectedRoute user={user} membership={membership} requiredMembership="premium">
                <GroupAvailability />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/habit-recommendations" 
            element={
              <ProtectedRoute user={user} membership={membership} requiredMembership="premium">
                <HabitRecommendations />
              </ProtectedRoute>
            } 
          />

          {/* Redirect to home if route not found */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </Elements>
    </div>
  );
}

export default App;
